import { isLog } from "./../log_actionTypes";

interface ss {
  loading: boolean;
  users: [];
  error: string;
}

const initialstate: ss = {
  loggedIn: true,
};

const IsLoggedReducer = (state = initialstate, action: any) => {
  switch (action.type) {
    case isLog:
      return !state;
    default:
      return state;
  }
};

export default IsLoggedReducer;
